  const [videoName, setVideoName] = useState("aqua");

  return (
    <div className={styles.homepage}>
      <video className={styles.homepage__video} autoPlay loop muted>
        <source src={`/assets/video/${videoName}.mp4`} type="video/mp4" />
        Your browser doesn't support video.
      </video>

      <img src={`/assets/images/Logo.png`} alt="Logo" className={styles.homepage__logo}/>

      <Actions />
      <Clock />
      {/* <Pomodoro /> */}
      {/* <Calendar /> */}
      <Music />
    </div>
  );
}

export default Homepage;
